import React from "react";
import { Container, SearchBar, SearchInput } from "./Styles";
import "./Search.css";

const Search = () => {
  return (
    <Container>
      <SearchBar>
        <SearchInput>
          <div className="search_icon">
            <i className="fas fa-search"></i>
          </div>
          <input
            type="text"
            name="repo"
            id="repo"
            placeholder="Search repositorie"
          />
        </SearchInput>
      </SearchBar>
    </Container>
  );
};

export default Search;
